@testset "7.3.6 Exponentials of inverse hyperbolic tangent functions" begin
    (a, b, c, m, n, p, x, ) = @variables a b c m n p x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*u*ℯ^(n*atanh(a*x))=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n*atanh(a*x))=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n*atanh(a*x))=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [ℯ^atanh(a*x)*x^4, x, 6, -((4*x^2*sqrt(1 - a^2*x^2))/(15*a^3)) - (x^3*sqrt(1 - a^2*x^2))/(4*a^2) - (x^4*sqrt(1 - a^2*x^2))/(5*a) - ((64 + 45*a*x)*sqrt(1 - a^2*x^2))/(120*a^5) + (3*asin(a*x))/(8*a^5)]
    @test_int [ℯ^atanh(a*x)*x^3, x, 5, -((x^2*sqrt(1 - a^2*x^2))/(3*a^2)) - (x^3*sqrt(1 - a^2*x^2))/(4*a) - ((16 + 9*a*x)*sqrt(1 - a^2*x^2))/(24*a^4) + (3*asin(a*x))/(8*a^4)]
    @test_int [ℯ^atanh(a*x)*x^2, x, 7, -(sqrt(1 - a^2*x^2)/a^3) - (x*sqrt(1 - a^2*x^2))/(2*a^2) + (1 - a^2*x^2)^(3/2)/(3*a^3) + asin(a*x)/(2*a^3)]
    @test_int [ℯ^atanh(a*x)*x^1, x, 3, -(((2 + a*x)*sqrt(1 - a^2*x^2))/(2*a^2)) + asin(a*x)/(2*a^2)]
    @test_int [ℯ^atanh(a*x)*x^0, x, 3, -(sqrt(1 - a^2*x^2)/a) + asin(a*x)/a]
    @test_int [ℯ^atanh(a*x)/x^1, x, 6, asin(a*x) - atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^atanh(a*x)/x^2, x, 5, -(sqrt(1 - a^2*x^2)/x) - a*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^atanh(a*x)/x^3, x, 6, -(sqrt(1 - a^2*x^2)/(2*x^2)) - (a*sqrt(1 - a^2*x^2))/x - (1/2)*a^2*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^atanh(a*x)/x^4, x, 7, -(sqrt(1 - a^2*x^2)/(3*x^3)) - (a*sqrt(1 - a^2*x^2))/(2*x^2) - (2*a^2*sqrt(1 - a^2*x^2))/(3*x) - (1/2)*a^3*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^atanh(a*x)/x^5, x, 8, -(sqrt(1 - a^2*x^2)/(4*x^4)) - (a*sqrt(1 - a^2*x^2))/(3*x^3) - (3*a^2*sqrt(1 - a^2*x^2))/(8*x^2) - (2*a^3*sqrt(1 - a^2*x^2))/(3*x) - (3/8)*a^4*atanh(sqrt(1 - a^2*x^2))]


    @test_int [ℯ^(2*atanh(a*x))*x^3, x, 3, -((2*x)/a^3) - x^2/a^2 - (2*x^3)/(3*a) - x^4/4 - (2*log(1 - a*x))/a^4]
    @test_int [ℯ^(2*atanh(a*x))*x^2, x, 3, -((2*x)/a^2) - x^2/a - x^3/3 - (2*log(1 - a*x))/a^3]
    @test_int [ℯ^(2*atanh(a*x))*x^1, x, 3, -((2*x)/a) - x^2/2 - (2*log(1 - a*x))/a^2]
    @test_int [ℯ^(2*atanh(a*x))*x^0, x, 3, -x - (2*log(1 - a*x))/a]
    @test_int [ℯ^(2*atanh(a*x))/x^1, x, 3, log(x) - 2*log(1 - a*x)]
    @test_int [ℯ^(2*atanh(a*x))/x^2, x, 3, -(1/x) + 2*a*log(x) - 2*a*log(1 - a*x)]
    @test_int [ℯ^(2*atanh(a*x))/x^3, x, 3, -(1/(2*x^2)) - (2*a)/x + 2*a^2*log(x) - 2*a^2*log(1 - a*x)]
    @test_int [ℯ^(2*atanh(a*x))/x^4, x, 3, -(1/(3*x^3)) - a/x^2 - (2*a^2)/x + 2*a^3*log(x) - 2*a^3*log(1 - a*x)]


    @test_int [ℯ^(3*atanh(a*x))*x^2, x, 10, (1 + a*x)^3/(a^3*sqrt(1 - a^2*x^2)) + ((3 + a*x)^2*sqrt(1 - a^2*x^2))/(3*a^3) + ((28 + 3*a*x)*sqrt(1 - a^2*x^2))/(6*a^3) - (11*asin(a*x))/(2*a^3)]
    @test_int [ℯ^(3*atanh(a*x))*x^1, x, 9, (9*sqrt(1 - a^2*x^2))/(2*a^2) + (3*(1 - a^2*x^2)^(3/2))/(2*a^2*(1 - a*x)) + (1 - a^2*x^2)^(5/2)/(a^2*(1 - a*x)^3) - (9*asin(a*x))/(2*a^2)]
    @test_int [ℯ^(3*atanh(a*x))*x^0, x, 5, (2*(1 + a*x)^2)/(a*sqrt(1 - a^2*x^2)) + (3*sqrt(1 - a^2*x^2))/a - (3*asin(a*x))/a]
    @test_int [ℯ^(3*atanh(a*x))/x^1, x, 8, (4*sqrt(1 - a^2*x^2))/(1 - a*x) - asin(a*x) - atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(3*atanh(a*x))/x^2, x, 8, -(sqrt(1 - a^2*x^2)/x) + (4*a*sqrt(1 - a^2*x^2))/(1 - a*x) - 3*a*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(3*atanh(a*x))/x^3, x, 12, -(sqrt(1 - a^2*x^2)/(2*x^2)) - (3*a*sqrt(1 - a^2*x^2))/x + (4*a^2*sqrt(1 - a^2*x^2))/(1 - a*x) - (9/2)*a^2*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(3*atanh(a*x))/x^4, x, 14, -(sqrt(1 - a^2*x^2)/(3*x^3)) - (3*a*sqrt(1 - a^2*x^2))/(2*x^2) - (14*a^2*sqrt(1 - a^2*x^2))/(3*x) + (4*a^3*sqrt(1 - a^2*x^2))/(1 - a*x) - (11/2)*a^3*atanh(sqrt(1 - a^2*x^2))]


    @test_int [ℯ^(4*atanh(a*x))*x^3, x, 3, (12*x)/a^3 + (4*x^2)/a^2 + (4*x^3)/(3*a) + x^4/4 + 4/(a^4*(1 - a*x)) + (16*log(1 - a*x))/a^4]
    @test_int [ℯ^(4*atanh(a*x))*x^2, x, 3, (8*x)/a^2 + (2*x^2)/a + x^3/3 + 4/(a^3*(1 - a*x)) + (12*log(1 - a*x))/a^3]
    @test_int [ℯ^(4*atanh(a*x))*x^1, x, 3, (4*x)/a + x^2/2 + 4/(a^2*(1 - a*x)) + (8*log(1 - a*x))/a^2]
    @test_int [ℯ^(4*atanh(a*x))*x^0, x, 3, x + 4/(a*(1 - a*x)) + (4*log(1 - a*x))/a]
    @test_int [ℯ^(4*atanh(a*x))/x^1, x, 3, 4/(1 - a*x) + log(x)]
    @test_int [ℯ^(4*atanh(a*x))/x^2, x, 3, -(1/x) + (4*a)/(1 - a*x) + 4*a*log(x) - 4*a*log(1 - a*x)]
    @test_int [ℯ^(4*atanh(a*x))/x^3, x, 3, -(1/(2*x^2)) - (4*a)/x + (4*a^2)/(1 - a*x) + 8*a^2*log(x) - 8*a^2*log(1 - a*x)]
    @test_int [ℯ^(4*atanh(a*x))/x^4, x, 3, -(1/(3*x^3)) - (2*a)/x^2 - (8*a^2)/x + (4*a^3)/(1 - a*x) + 12*a^3*log(x) - 12*a^3*log(1 - a*x)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [ℯ^(-atanh(a*x))*x^3, x, 5, -((x^2*sqrt(1 - a^2*x^2))/(3*a^2)) + (x^3*sqrt(1 - a^2*x^2))/(4*a) - ((16 - 9*a*x)*sqrt(1 - a^2*x^2))/(24*a^4) - (3*asin(a*x))/(8*a^4)]
    @test_int [ℯ^(-atanh(a*x))*x^2, x, 7, sqrt(1 - a^2*x^2)/a^3 - (x*sqrt(1 - a^2*x^2))/(2*a^2) - (1 - a^2*x^2)^(3/2)/(3*a^3) + asin(a*x)/(2*a^3)]
    @test_int [ℯ^(-atanh(a*x))*x^1, x, 3, -(((2 - a*x)*sqrt(1 - a^2*x^2))/(2*a^2)) - asin(a*x)/(2*a^2)]
    @test_int [ℯ^(-atanh(a*x))*x^0, x, 3, sqrt(1 - a^2*x^2)/a + asin(a*x)/a]
    @test_int [ℯ^(-atanh(a*x))/x^1, x, 6, -asin(a*x) - atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-atanh(a*x))/x^2, x, 5, -(sqrt(1 - a^2*x^2)/x) + a*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-atanh(a*x))/x^3, x, 6, -(sqrt(1 - a^2*x^2)/(2*x^2)) + (a*sqrt(1 - a^2*x^2))/x - (1/2)*a^2*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-atanh(a*x))/x^4, x, 7, -(sqrt(1 - a^2*x^2)/(3*x^3)) + (a*sqrt(1 - a^2*x^2))/(2*x^2) - (2*a^2*sqrt(1 - a^2*x^2))/(3*x) + (1/2)*a^3*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-atanh(a*x))/x^5, x, 8, -(sqrt(1 - a^2*x^2)/(4*x^4)) + (a*sqrt(1 - a^2*x^2))/(3*x^3) - (3*a^2*sqrt(1 - a^2*x^2))/(8*x^2) + (2*a^3*sqrt(1 - a^2*x^2))/(3*x) - (3/8)*a^4*atanh(sqrt(1 - a^2*x^2))]


    @test_int [ℯ^(-2*atanh(a*x))*x^3, x, 3, (2*x)/a^3 - x^2/a^2 + (2*x^3)/(3*a) - x^4/4 - (2*log(1 + a*x))/a^4]
    @test_int [ℯ^(-2*atanh(a*x))*x^2, x, 3, -((2*x)/a^2) + x^2/a - x^3/3 + (2*log(1 + a*x))/a^3]
    @test_int [ℯ^(-2*atanh(a*x))*x^1, x, 3, (2*x)/a - x^2/2 - (2*log(1 + a*x))/a^2]
    @test_int [ℯ^(-2*atanh(a*x))*x^0, x, 3, -x + (2*log(1 + a*x))/a]
    @test_int [ℯ^(-2*atanh(a*x))/x^1, x, 3, log(x) - 2*log(1 + a*x)]
    @test_int [ℯ^(-2*atanh(a*x))/x^2, x, 3, -(1/x) - 2*a*log(x) + 2*a*log(1 + a*x)]
    @test_int [ℯ^(-2*atanh(a*x))/x^3, x, 3, -(1/(2*x^2)) + (2*a)/x + 2*a^2*log(x) - 2*a^2*log(1 + a*x)]
    @test_int [ℯ^(-2*atanh(a*x))/x^4, x, 3, -(1/(3*x^3)) + a/x^2 - (2*a^2)/x - 2*a^3*log(x) + 2*a^3*log(1 + a*x)]


    @test_int [ℯ^(-3*atanh(a*x))*x^3, x, 14, (1 - a*x)^3/(a^4*sqrt(1 - a^2*x^2)) + (27*sqrt(1 - a^2*x^2))/(4*a^4) + (x^2*sqrt(1 - a^2*x^2))/a^2 - (x^3*sqrt(1 - a^2*x^2))/(4*a) + (9*(2 - 3*a*x)*sqrt(1 - a^2*x^2))/(8*a^4) + (51*asin(a*x))/(8*a^4)]
    @test_int [ℯ^(-3*atanh(a*x))*x^2, x, 10, -((1 - a*x)^3/(a^3*sqrt(1 - a^2*x^2))) - ((28 - 3*a*x)*sqrt(1 - a^2*x^2))/(6*a^3) - ((3 - a*x)^2*sqrt(1 - a^2*x^2))/(3*a^3) - (11*asin(a*x))/(2*a^3)]
    @test_int [ℯ^(-3*atanh(a*x))*x^1, x, 9, (9*sqrt(1 - a^2*x^2))/(2*a^2) + (3*(1 - a^2*x^2)^(3/2))/(2*a^2*(1 + a*x)) + (1 - a^2*x^2)^(5/2)/(a^2*(1 + a*x)^3) + (9*asin(a*x))/(2*a^2)]
    @test_int [ℯ^(-3*atanh(a*x))*x^0, x, 5, -((2*(1 - a*x)^2)/(a*sqrt(1 - a^2*x^2))) - (3*sqrt(1 - a^2*x^2))/a - (3*asin(a*x))/a]
    @test_int [ℯ^(-3*atanh(a*x))/x^1, x, 8, (4*sqrt(1 - a^2*x^2))/(1 + a*x) + asin(a*x) - atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-3*atanh(a*x))/x^2, x, 8, -(sqrt(1 - a^2*x^2)/x) - (4*a*sqrt(1 - a^2*x^2))/(1 + a*x) + 3*a*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-3*atanh(a*x))/x^3, x, 12, -(sqrt(1 - a^2*x^2)/(2*x^2)) + (3*a*sqrt(1 - a^2*x^2))/x + (4*a^2*sqrt(1 - a^2*x^2))/(1 + a*x) - (9/2)*a^2*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-3*atanh(a*x))/x^4, x, 14, -(sqrt(1 - a^2*x^2)/(3*x^3)) + (3*a*sqrt(1 - a^2*x^2))/(2*x^2) - (14*a^2*sqrt(1 - a^2*x^2))/(3*x) - (4*a^3*sqrt(1 - a^2*x^2))/(1 + a*x) + (11/2)*a^3*atanh(sqrt(1 - a^2*x^2))]
    @test_int [ℯ^(-3*atanh(a*x))/x^5, x, 19, -(sqrt(1 - a^2*x^2)/(4*x^4)) + (a*sqrt(1 - a^2*x^2))/x^3 - (19*a^2*sqrt(1 - a^2*x^2))/(8*x^2) + (6*a^3*sqrt(1 - a^2*x^2))/x + (4*a^4*sqrt(1 - a^2*x^2))/(1 + a*x) - (51/8)*a^4*atanh(sqrt(1 - a^2*x^2))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n/2*atanh(a*x))=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [ℯ^(atanh(a*x)/2)*x^m, x, 2, (x^(1 + m)*AppellF1(1 + m, 1/4, -(1/4), 2 + m, a*x, (-a)*x))/(1 + m)]

    @test_int [ℯ^(atanh(a*x)/2)*x^2, x, 15, -((3*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(8*a^3)) - ((1 - a*x)^(3/4)*(1 + a*x)^(5/4))/(12*a^3) - (x*(1 - a*x)^(3/4)*(1 + a*x)^(5/4))/(3*a^2) + (3*atan(1 - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4)))/(8*sqrt(2)*a^3) - (3*atan(1 + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4)))/(8*sqrt(2)*a^3) - (3*log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4)))/(16*sqrt(2)*a^3) + (3*log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4)))/(16*sqrt(2)*a^3)]
    @test_int [ℯ^(atanh(a*x)/2)*x^1, x, 14, -(((1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(4*a^2)) - ((1 - a*x)^(3/4)*(1 + a*x)^(5/4))/(2*a^2) + atan(1 - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(4*sqrt(2)*a^2) - atan(1 + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(4*sqrt(2)*a^2) - log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(8*sqrt(2)*a^2) + log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(8*sqrt(2)*a^2)]
    @test_int [ℯ^(atanh(a*x)/2)*x^0, x, 13, -(((1 - a*x)^(3/4)*(1 + a*x)^(1/4))/a) + atan(1 - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(sqrt(2)*a) - atan(1 + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(sqrt(2)*a) - log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(2*sqrt(2)*a) + log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/(2*sqrt(2)*a)]
    @test_int [ℯ^(atanh(a*x)/2)/x^1, x, 17, -2*atan((1 + a*x)^(1/4)/(1 - a*x)^(1/4)) + sqrt(2)*atan(1 - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4)) - sqrt(2)*atan(1 + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4)) - 2*atanh((1 + a*x)^(1/4)/(1 - a*x)^(1/4)) - log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) - (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/sqrt(2) + log(1 + sqrt(1 - a*x)/sqrt(1 + a*x) + (sqrt(2)*(1 - a*x)^(1/4))/(1 + a*x)^(1/4))/sqrt(2)]
    @test_int [ℯ^(atanh(a*x)/2)/x^2, x, 6, -(((1 - a*x)^(3/4)*(1 + a*x)^(1/4))/x) - a*atan((1 + a*x)^(1/4)/(1 - a*x)^(1/4)) - a*atanh((1 + a*x)^(1/4)/(1 - a*x)^(1/4))]
    @test_int [ℯ^(atanh(a*x)/2)/x^3, x, 7, -((a*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(4*x)) - ((1 - a*x)^(3/4)*(1 + a*x)^(5/4))/(2*x^2) - (1/4)*a^2*atan((1 + a*x)^(1/4)/(1 - a*x)^(1/4)) - (1/4)*a^2*atanh((1 + a*x)^(1/4)/(1 - a*x)^(1/4))]
    @test_int [ℯ^(atanh(a*x)/2)/x^4, x, 9, -(((1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(3*x^3)) - (5*a*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(12*x^2) - (11*a^2*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(24*x) - (3/8)*a^3*atan((1 + a*x)^(1/4)/(1 - a*x)^(1/4)) - (3/8)*a^3*atanh((1 + a*x)^(1/4)/(1 - a*x)^(1/4))]
    @test_int [ℯ^(atanh(a*x)/2)/x^5, x, 10, -(((1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(4*x^4)) - (7*a*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(24*x^3) - (29*a^2*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(96*x^2) - (83*a^3*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(192*x) - (11/64)*a^4*atan((1 + a*x)^(1/4)/(1 - a*x)^(1/4)) - (11/64)*a^4*atanh((1 + a*x)^(1/4)/(1 - a*x)^(1/4))]
    @test_int [ℯ^(atanh(a*x)/2)/x^6, x, 11, -(((1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(5*x^5)) - (9*a*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(40*x^4) - (11*a^2*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(48*x^3) - (269*a^3*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(960*x^2) - (611*a^4*(1 - a*x)^(3/4)*(1 + a*x)^(1/4))/(1920*x) - (31/128)*a^5*atan((1 + a*x)^(1/4)/(1 - a*x)^(1/4)) - (31/128)*a^5*atanh((1 + a*x)^(1/4)/(1 - a*x)^(1/4))]


